import React, {
  useState,
  useEffect,
} from "react";

export default function Products() {
  const [products, setProducts] =
    useState([]);

  useEffect(() => {
    fetch(
      "http://192.168.0.10:3000/data/products.json",
      {
        headers: {
          "Content-Type":
            "application/json",
          Accept: "application/json",
        },
      }
    )
      .then((response) =>
        response.json()
      )
      .then((json) =>
        setProducts(json)
      );
  }, []);

  return (
    <div>
      <ul>
        {products.map((p) => (
          <li>{p.name}</li>
        ))}
      </ul>
    </div>
  );
}
